function drawPie3d() {
    var e = google.visualization.arrayToDataTable([
        ["Category", "Number of Participant"],
        ["Bank Sampah Unit", 21],
        ["Bisnis", 3],
        ["Hotel", 2],
        ["Sekolah", 1],
        ["Jasa Sampah", 7],
        ["Pengepul", 7],
        ["TPS3R", 5],
        ["TPST3R", 6],
        ["TPA", 1],
    ]);
    new google.visualization.PieChart(document.getElementById("pie-3d")).draw(e, {
        title: "Number of Participant",
        is3D: !0,
        height: 400,
        fontSize: 12,
        colors: ["#99B898", "#FECEA8", "#FF847C", "#E84A5F", "#474747"],
        chartArea: { left: "5%", width: "90%", height: 350 },
    });
}
google.load("visualization", "1.0", { packages: ["corechart"] }),
    google.setOnLoadCallback(drawPie3d),
    $(function () {
        function e() {
            drawPie3d();
        }
        $(window).on("resize", e), $(".menu-toggle").on("click", e);
    });
